import React, { Component } from 'react';
import './videos.css';

class Videos extends Component {
    constructor () {
        super();
        this.state = {
            videos: []
        }
    }

    componentDidMount() {
        fetch('http://localhost:8080/api/channel')
        //.then(res => res.json())
        .then(videos => this.setState({videos: videos}, () => console.log('Videos fetched: ', videos)));
    }

    render () {
        return (
            <div className="App">
              <h2>Videos</h2>
              <ul>
                  {this.state.videos.map(item => 
                    <li key={item.id.videoId}>
                        {item.snippet.title}
                        {item.snippet.description}
                        {item.snippet.thumbnails.medium}
                    </li>
                  )}
              </ul>
            </div>
        );
    }
}

export default Videos;
